import React, { useState } from "react";

function General() {
    const info = {
        firstName: '',
        lastName: '',
        address: '',
        phoneNumber: '',
        email: '',
        description: ''
    }
    return (
        <div className="generalInformation">
            <h1> Personal Information </h1>
            <input className="info" type="text" placeholder="First Name" id="first-name"/>
            <input className="info" type="text" placeholder="Last Name" id="last-name"/>
            <input className="info" type="text" placeholder="Address" id="address"/>
            <input className="info" type="text" placeholder="Phone Number" id="phone-number"/>
            <input className="info" type="text" placeholder="Email" id="email"/>
            <input className="info" type="text" placeholder="Description" id="description"/>
            <button></button>
        </div>
    )
}

export default General;
